(1, 'admin_forgot', 'Admin Forgot Password', 'Admin Forgot Password', '<table>\r\n                <tr>\r\n                    <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Hi</b> Admin,</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\">You have successfully retrieved login credentials!</p>\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><a href=\"[!HTTP_PATH!]/admin/admins/login\" style=\"color:#434343;\">Click Here</a> To Login.</p>\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Username:</strong> [!username!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Password:</strong> [!password!]</p>  \r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47');
INSERT INTO `emailtemplates` (`id`, `static_email_heading`, `title`, `subject`, `template`, `created_at`, `updated_at`) VALUES
(2, 'user_added_from_admin', 'Register Added From Admin', 'Welcome on [!SITE_TITLE!]', '<table><tr>\r\n                <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Hi</b> [!username!],</td>\r\n            </tr>\r\n            <tr>\r\n                <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                    <p style=\"color:#434343;margin:10px 0 0;\">Your customer account has been created successfully by admin on [!SITE_TITLE!]</p>\r\n                    <p style=\"color:#434343;margin:10px 0 0;\">Details are below :</p>\r\n                    <p style=\"color:#434343;margin:10px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>\r\n                    <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Password:</strong> [!password!]</p>  \r\n                </td>\r\n            </tr>\r\n        </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47');
INSERT INTO `emailtemplates` (`id`, `static_email_heading`, `title`, `subject`, `template`, `created_at`, `updated_at`) VALUES
(3, 'user_register', 'User Registration', 'Welcome to [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343; margin:0px 0 0;\">We are pleased to announce that your account has been created successfully.</p>\r\n                        <p style=\"color:#434343; margin:0px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>   \r\n                        <p style=\"color:#434343; margin:10px 0 0;\">Please click the link below to verify your Email address. </p>\r\n                        <p style=\"color:#434343; margin:0px 0 0;\"><a style=\"text-decoration:underline;\" href=\"[!link!]\">Click here</a> to verify your Email address. </p>\r\n            \r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47');
INSERT INTO `emailtemplates` (`id`, `static_email_heading`, `title`, `subject`, `template`, `created_at`, `updated_at`) VALUES
(4, 'forgot_password', 'Forgot Password', '[!SITE_TITLE!] Reset password', '<table>\r\n                <tr>\r\n                    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\">Please reset your Password on <a href=\"<?php echo HTTP_PATH;?>\" style=\"color:#eb2f23;text-decoration: underline;\"></a> [!SITE_TITLE!].</p>\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><a href=\"[!link!]\" style=\"color:#434343; \">Click here</a> to reset your account password.</p>\r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
(5, 'user_register_social', 'User Registration by Social', 'Welcome on [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\">Welcome to</b> [!SITE_TITLE!]</p>\r\n                        <p style=\"color:#434343; margin:0px 0 0;\">We are pleased to announce that your account has been created using [!login_type!] successfully.</p>\r\n                        <p style=\"color:#434343; margin:0px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>\r\n                        <p style=\"color:#434343; margin:0px 0 0;\"><strong style=\"width:150px;\">Password:</strong> [!password!]</p>    \r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
(6, 'contact_email', 'Contact email send to admin', '[!name!] send Enquiry on [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Hi</b> Admin,</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\">Soneone send enquiry on [!SITE_TITLE!] via contact us with below details</p>\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><strong style=\"width:150px;\">Name:</strong> [!name!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Contact Number:</strong> [!contact!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Message:</strong> [!message!]</p>  \r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
(7, 'offer_sent_buyer', 'Offer detail sent to buyer', '[!name!] has sent offer for your service request on [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><b>[!name!]</b> has sent an offer on your service request <b>[!title!]</b>  on [!SITE_TITLE!] with below details.</p>\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><strong style=\"width:150px;\">Name:</strong> [!name!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Amount:</strong> [!amount!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Deliver in:</strong> [!deliver_in!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Message:</strong> [!message!]</p>  \r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
(8, 'offer_rejected_email', 'Offer rejected by buyer', 'Your offer has been rejected by buyer on [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\">Your offer on service request <b>[!title!]</b> has been rejected by buyer on [!SITE_TITLE!].</p>\r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
(9, 'offer_accepted_email', 'Offer accepted by buyer', 'Your offer has been accepted by buyer on [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\">Your offer on service request <b>[!title!]</b> has been accepted by buyer on [!SITE_TITLE!].</p>\r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
(10, 'service_accept_paypal_payment_user', 'Email sent to user when accept service request and pay using PayPal', 'You have successfully accepted offer on [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\">You have successfully accepted seller offer and made payment on [!SITE_TITLE!] with below details.</p>\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><strong style=\"width:150px;\">Title:</strong> [!title!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Amount:</strong> [!amount!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">TransactionID:</strong> [!transactionId!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Payment Method:</strong> [!paymenttype!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Date:</strong> [!datetime!]</p>  \r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
(11, 'service_accept_paypal_payment_admin', 'Email sent to admin when accept service request and pay using PayPal', '[!username!] has accepted offer and mad payment via [!paymenttype!] on [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> Admin,</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><b>[!username!]</b> has accepted seller offer and made payment on [!SITE_TITLE!] with below details.</p>\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><strong style=\"width:150px;\">Title:</strong> [!title!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Buyer Name:</strong> [!username!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Amount:</strong> [!amount!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">TransactionID:</strong> [!transactionId!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Payment Method:</strong> [!paymenttype!]</p>\r\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Date:</strong> [!datetime!]</p>  \r\n                    </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
(12, 'service_accept_paypal_payment_seller', 'Email sent to seller when accept service request and pay using PayPal', '[!username!] has accepted your offer on [!SITE_TITLE!]', '<table>\r\n                <tr>\r\n                    <td style=\"color:#002859; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!sellername!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343;margin:10px 0 0;\"><b>[!username!]</b> has accepted your offer sent by you on service request <b>[!title!]</b> on [!SITE_TITLE!].</p>\r\n                      </td>\r\n                </tr>\r\n            </table>', '2023-04-17 08:46:47', '2023-04-17 08:46:47'),
