  <ul>\r\n                    <li>\r\n                    <p>Violates these Terms of Use;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Allows you to scrape, monitor, or copy any part of the Services in an automated way, using any robot, scraper, or other method of access other than manually accessing the publicly-available portions of the Services;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Violates the restrictions in any robot exclusion headers of the Services, or bypasses or circumvents other measures to prevent or limit access to the Services;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Creates any derivative works from the Services;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Competes with our business or impacts our revenue;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Impairs our computer systems or transmits software viruses, worms, or other harmful files;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Interferes with any other party&rsquo;s use and enjoyment of the Services;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Attempts to gain unauthorized access to the Services;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Uses any part of the Services in unsolicited mailings or spam material;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Violates any third party&rsquo;s rights, including copyright, trademark, privacy rights, or any other intellectual property or proprietary rights;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Threatens, stalks, harms, or harasses others, misleads or deceives others, promotes bigotry or discrimination, defames others, or is otherwise objectionable; solicits personal information, promotes illegal substances, or submits or transmits pornography; or</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Violates any laws.</p>\r\n                    </li>\r\n                </ul>\r\n                \r\n                <p><strong>6. YOUR CONTENT AND SUBMISSIONS</strong><br />\r\n                You are solely responsible for all content that you post, publish, transmit, upload, distribute or otherwise make available or submit to or through the Services, including without limitation to or through the Community (collectively, &ldquo;Submissions&rdquo;). Your Submissions may be identified by your actual name and/or your username, and may be linked to your Egreea Account and Community profile. You acknowledge that once published, you cannot withdraw such Submissions. Unless we indicate otherwise, you grant us, our subsidiaries, and affiliates a nonexclusive, transferrable, royalty-free, perpetual, irrevocable, and fully sub licensable right to use, reproduce, modify, adapt, publish, translate, create derivative works from, distribute, copy, and display any Submissions throughout the world in any form.</p>\r\n                \r\n                <p>You represent and warrant that you own or otherwise control all of the rights to your Submissions and that your Submissions will not violate these Terms of Use or cause injury to any other person or entity. We take no responsibility and assume no liability for any material, content, opinion, recommendation, or advice provided by you in your Submissions or by any third party. We have no obligation to post any of your Submissions, and reserve the right to post our own versions of that content (including, but not limited to, photos of properties or property descriptions) instead of yours in our sole discretion.</p>\r\n                \r\n                <p>You assign us the right to pursue enforcement of copyright and other intellectual property claims against third parties that have, without authorization, and in violation of these Terms of Use, scraped, copied, or distributed content from your Submissions and for which you have not granted such third parties a separate license to use.</p>\r\n                \r\n                <p>Please review our Privacy Statement prior to making any Submissions. If you do not agree with our Privacy Statement, you may not make any Submissions.</p>\r\n                \r\n                <p>In addition to complying with the rules specified in these Terms of Use, you agree to comply with the following rules when participating in the Community and/or making any Submissions. This list is not meant to be exhaustive, and we reserve the right to determine what types of conduct we consider to be inappropriate use of the Services. In the case of inappropriate use, we may take such measures as we determine appropriate, in our sole discretion. By way of example, and not as limitation, you agree to abide by the following rules when participating in the Community and/or making any Submissions:</p>\r\n                \r\n                <ul>\r\n                    <li>\r\n                    <p>You will remain polite and civil to other users, even if you disagree with content that you come across through your use of the Services;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Your Submissions will not be off topic or contain promotions of or solicitations for other products, services or fundraising activities;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Your Submissions will not infringe or violate our rights or the rights of a third party;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>You will not impersonate anyone else, misrepresent your identity or affiliation, or make Submissions from fake or anonymous profiles;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>You agree that we are not liable for Submissions made by you or others;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>You agree that we have the right to remove or edit any content and any Submissions in our sole discretion;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Your Submissions will not consist of any inappropriate content, including without limitation personal attacks, offensive remarks, obscenities or any language that we consider foul, vulgar or fraudulent;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>Your Submissions will not contain images of any person, unless you have received their permission, or the permission of their parent or guardian if the person is under the age of 18 or unable to provide consent for any reason;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>You will not share viruses or files that have the capability of causing damage to another&rsquo;s computer;</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>You agree that we have the right to delete, modify or remove any Submissions, at any time in our sole discretion and that you are solely responsible to backup any such content; and</p>\r\n                    </li>\r\n                    <li>\r\n                    <p>You agree that when you use the Services you do so at your own risk and that you understand that Submissions that you see may not be accurate. While we may monitor Submissions, we are under no obligation to do so.</p>\r\n                    </li>\r\n                </ul>\r\n                \r\n                <p><strong>7. REPORTING COPYRIGHT INFRINGEMENT</strong><br />\r\n                We have adopted and implemented a policy that provides for the termination in appropriate circumstances of subscribers and account holders of our Services who are copyright infringers. If you believe your copyright or the copyright of a person on whose behalf you are authorized to act has been infringed, you may provide us with a written Notice of Alleged Infringement (&ldquo;Notice&rdquo;). You must do all of the following in your written Notice for it to be valid:</p>\r\n                \r\n                <p>A. Identify the copyrighted work that you claim has been infringed, or &ndash; if multiple copyrighted works are covered by this Notice &ndash; you may provide a representative list of the copyrighted works that you claim have been infringed.</p>\r\n                \r\n                <p>B. Identify the material that you claim is infringing (or to be the subject of infringing activity) and that is to be removed or access to which is to be disabled, and information reasonably sufficient to permit us to locate the material, including (if the Content is on our website) the URL of the link shown on the website where such material may be found.</p>\r\n                \r\n                <p>C. Include your mailing address, telephone number, and, if available, email address.</p>\r\n                \r\n                <p>D. Include both of the following statements in the body of the Notice (if these statements are untrue, you cannot submit the Notice):</p>\r\n                \r\n                <p>&ldquo;I have a good faith belief that the disputed use of the copyrighted material is not authorized by the copyright owner, its agent, or the law (e.g., as a fair use).&rdquo;</p>\r\n                \r\n                <p>&ldquo;The information in this Notice is accurate and, under penalty of perjury, I affirm that I am the owner, or authorized to act on behalf of the owner, of the copyright or of an exclusive right under the copyright that is allegedly infringed.&rdquo;</p>\r\n                \r\n                <p>E. Provide your full legal name and your electronic or physical signature.</p>\r\n                \r\n                <p>Deliver this Notice, with all items completed, to Company&rsquo;s Copyright Agent:</p>\r\n                \r\n                <p><strong>8. DISCLAIMER OF WARRANTIES</strong><br />\r\n                You agree that your use of the services is at your sole risk and acknowledge that all information contained in the services is provided &ldquo;as is&rdquo; and &ldquo;as available,&rdquo; and that we disclaim all warranties, either express or implied, as to the services, including, but not limited to, implied warranties of merchantability, fitness for a particular purpose, title and non-infringement. We make no representations or guarantees that the Services are compatible with your equipment or that the Services, or that any electronic communications sent by us or our affiliates, are error-free or will be free from loss, destruction, damage, interruption, corruption, attack, viruses, worms, or other harmful, invasive, or corrupted files, interference, hacking, or other security intrusion, and we disclaim any liability relating thereto. You agree that we have the right to change the content or technical specifications of any aspect of the Services at any time in our sole discretion. You further agree that such changes may result in you being unable to access the Services.</p>\r\n                \r\n                <p>We make no guarantees, representations, or warranties that the Services or information available through the Services, or that the use of or result of the use of the Services, will be accurate, reliable, complete, current, uninterrupted, or without errors. Any documents, pictures, or other information available on the Services are for informational purposes only, and may not represent the current condition of a property or the condition of the property at the time of sale. The posting of pictures on the Services does not constitute a guarantee that any items represented in the pictures will be present when a buyer takes possession of a property. You are encouraged to conduct your own due diligence and investigate all matters relating to any properties. It is recommended that you seek independent advice, including legal advice, to perform your due diligence and that you use good faith efforts in determining that the content of all information provided to or obtained by you is accurate.</p>\r\n                \r\n                <p>You understand and acknowledge that the information provided through the Services is subject to change. You should check back frequently for updated information as to the properties and/or mortgage notes available, marketing or transaction events, times and locations, relevant terms, and other matters which may be made available by us or our clients.</p>\r\n                \r\n                <p>Some of the available content, services, and information may include materials that belong to or that are submitted by third parties. You acknowledge that we assume no responsibility for such content, services, or information. The content of other websites, services, goods, or advertisements that may be linked to or from the Services is not maintained or controlled by us. We do not: (i) make any warranty, express or implied, with respect to the use of the links provided on, or to, the Services; (ii) guarantee the accuracy, completeness, usefulness or adequacy of any other websites, services, or goods, that may be linked to or from the Services; or (iii) make any endorsement of any other websites, services, or goods that may be linked to or from the Services.</p>\r\n                \r\n                <p>You understand and acknowledge that you are capable of evaluating the merits and risks of purchasing or selling a property using the Services, and are able to bear any such risks. You also acknowledge that you have consulted with, had the opportunity to consult with, or waive the right to consult with, legal and tax professionals relating to the legal and tax consequences of any documents used in connection with the Services.</p>\r\n                \r\n                <p><strong>9. LIMITATIONS OF LIABILITY</strong><br />\r\n                Under no circumstances, including but not limited to negligence, shall we, our subsidiaries, or affiliates be liable to you or any third party for direct, indirect, incidental, consequential, special, punitive, or exemplary damages, arising from use of or inability to use the services, including those caused by any failure of performance, error, omission, interruption, defect, delay in operation of transmission, computer virus, or line failure in connection with your use of the services, even if we have been advised of the possibility of such damages. applicable law may not allow the limitation or exclusion of liability or incidental or consequential damages, so the above exclusions and limitations may or may not apply to you.</p>\r\n                \r\n                <p><strong>10. INDEMNITY</strong><br />\r\n                You agree to indemnify, defend, and hold us, our subsidiaries, and affiliates harmless, including costs, liabilities and legal fees, from any claim or demand made by any third party arising out of or relating to: (i) your access to or use of the Services; (ii) your violation of any third party right, including without limitation any copyright, property, or privacy right; (iii) the content of your Submissions; or (iv) your breach of these Terms of Use. We reserve the right, at your expense, to assume the exclusive defence and control of any matter subject to indemnification by you, and you agree to cooperate in such defence. You agree not to settle any matter in which you have indemnity obligations without our prior written consent. We will use reasonable efforts to notify you of any such claim, action or proceeding upon becoming aware of it.</p>\r\n                \r\n                <p><strong>11. PRIVACY STATEMENT</strong><br />\r\n                Our use of your information is governed at all times by our Privacy Statement. Our Privacy Statement explains our practices relating to the collection and use of your information in connection with the Services, and is incorporated into these Terms of Use. By using the Services, you consent to the collection and use of your information as set forth in the Privacy Statement.</p>\r\n                \r\n                <p><strong>12. TERMINATION OR STOPPING USE OF THE SERVICES</strong><br />\r\n                You can stop using the Services at any time and for any reason.</p>\r\n                \r\n                <p>Without prior notice, we may revoke your registration, suspend your ability to use certain parts of the Services, and/or terminate your access to the Services at any time in our discretion. We may also modify, suspend, or discontinue the Services.<br />\r\n                If you breach or threaten to breach any provision of these Terms of Use, in addition to terminating your right to use the Services, we shall be entitled to seek injunctive relief to enforce the provisions hereof, but nothing herein shall preclude us from pursuing any action or other remedy for breach or threatened breach of these Terms of Use. If we prevail in such action, we shall be entitled to recover from you all reasonable costs, expenses, and attorneys&rsquo; fees incurred in connection therewith.<br />\r\n                In order to protect the Services, we reserve the right at any time to block users from certain IP addresses from accessing and using the Services. We may also request that you stop accessing or permanently destroy certain content or information available through the Services.</p>\r\n                \r\n                <p><strong>13. Transaction and Negotiations</strong><br />\r\n                Services offered by Egreea are exclusively to facilitate a real estate transaction between vendors (sellers) and purchasers (buyers). Egreea holds no liability to negotiating on behalf of the vendor or the purchaser in the process of title transfer between the parties, which holds no accountability for Egreea on achieving a desired price point for the parties involved in the transaction. Parties may seek third party advisors to assist in conducting the transaction process, however Egreea outlines the process and provides the platform for transactions to occur but does not participate in communication, negotiation or persuasion of any kind to produce a price outcome for the parties.<br />\r\n                <br />\r\n                <strong>14. BINDING ARBITRATION AGREEMENT AND CLASS ACTION WAIVER</strong><br />\r\n                Please read this section carefully &ndash; it may significantly affect your legal rights, including your right to file a lawsuit in court and to have a jury hear your claims.</p>\r\n                \r\n                <p>By using the Services, you irrevocably agree: (i) to waive all rights to trial in a court before a judge or jury on any claim, action or dispute with us or relating in any way to your use of the Services or the interpretation, applicability, enforceability or formation of these Terms of Use including, but not limited to, any claim that all or any part of this agreement is void or voidable (&ldquo;Claims&rdquo;); (ii) that all Claims will be determined exclusively by final and binding arbitration in Orange County, California before one arbitrator; and (iii) that the arbitrator will not have the authority to consolidate the Claims of other users of the Services (&ldquo;Users&rdquo;) and will not have the authority to fashion a proceeding as a class or collective action or to award relief to a group or class of Users in one arbitration proceeding.</p>\r\n                \r\n                <p>The arbitration shall be administered in by a third party in pursuant to its Comprehensive Arbitration Rules and Procedures (&ldquo;Rules&rdquo;) and in accordance with the Expedited Procedures in those Rules. Notwithstanding these Rules, however, such proceeding shall be governed by the laws of the State of California. All parties shall maintain the confidential nature of the arbitration proceeding and the award, including the hearing, except as may be necessary to prepare for or conduct the arbitration hearing on the merits, or except as may be necessary in connection with a court application for a preliminary remedy, a judicial challenge to an award or its enforcement, or unless otherwise required by law or judicial decision.</p>\r\n                \r\n                <p>The arbitrator, and not any federal, state, or local court or agency, shall have exclusive authority to resolve any Claims. However, nothing in this section shall prevent us from enforcing our intellectual property rights and/or remedy unfair competition, misappropriation of trade secrets, unauthorized access, fraud or computer fraud, and/or industrial espionage in court.</p>\r\n                \r\n                <p>Judgment on any arbitration award may be entered in any court having jurisdiction. The prevailing party shall be entitled to an award of costs and lawyer fees reasonably incurred (a) in connection with any arbitration arising out of or related to these Terms of Use, or (b) to enforce the terms of these Terms of Use to arbitrate. If a party is deemed to be a prevailing party under circumstances where the prevailing party won on some but not all of the claims and counterclaims, the prevailing party may be awarded an appropriate percentage of the costs and attorneys&rsquo; fees reasonably incurred in connection with the arbitration or action.</p>\r\n                \r\n                <p><strong>15. SERVICES AUDITING AND MONITORING</strong><br />\r\n                We reserve the right to audit and monitor (manually or through automated means) the use of the Services to ensure compliance with these Terms of Use and to maintain and improve the provision of the Services. We also may, but are not required to, monitor the content on the Services using manual review or technical measures to screen, block, filter, edit or remove content. We may terminate or suspend users&rsquo; of Egreea or delete, edit or remove content that we, in our sole discretion, deem illegal, offensive, abusive, in violation of these Terms of Use or our other policies, or otherwise inappropriate or unacceptable. All enforcement determinations are made in our sole discretion, and we will not incur any liability or responsibility if we choose to remove or delete any content.</p>\r\n                \r\n                <p>You acknowledge, consent, and agree that we may access, preserve, and disclose information about your use of the Services, including your communications and content you submit, if required to do so by law or in a good faith believe that such access, preservation, or disclosure is reasonably necessary to: (i) comply with legal process; (ii) enforce these Terms of Use; (iii) respond to claims that any content you submit violates the rights of third parties; (iv) respond to your requests for customer service; or (v) protect the rights, property or personal safety of us, our users and the public.</p>\r\n                \r\n                <p><strong>16. SUBMITTING A BID OR OFFER </strong><br />\r\n                Registered buyers (&ldquo;purchasers&rdquo;) using Egreea to conduct negotiations with the seller (&ldquo;vendor&rdquo;), are obligated to fulfil their contractual duties of their states jurisdiction in purchasing a property estate. These obligations and requirements to be performed are outlined in the &lsquo;property listing&rsquo;s&rsquo; relevant forms for the buyer to populate before or after submitting an offer to the seller. It is the buyer&rsquo;s duty to complete these documents for their offer or bidding submission, however can indicate to the seller their interested price without first populating these documents, but by consenting with the submissions &lsquo;I agree&rsquo; terms and conditions of fulfilling their obligations to populate the forms at the later date when their offer is accepted. The buyer will be held binding to their offer submission with or without the relevant forms filled out and held responsible for carrying through with their obligations in continuance of the real estate process thereafter mutual consent to proceed from both the buyer and seller. By using Egreea as a buyer, you agree that you will fulfil your contractual obligations following the purchase of property thereafter your legally binding offer has or has not been accepted.</p>\r\n                \r\n                <p><strong>17. GENERAL TERMS</strong><br />\r\n                A. Force Majeure. No party shall be liable to the other for any default resulting from force majeure, which includes any circumstances beyond the reasonable control of the parties.</p>\r\n                \r\n                <p>B. Notices and Electronic Communications. We may provide you with notices, including those regarding changes to these Terms of Use by email, regular mail, telephone or communications though the Services. When you use the Services, you consent to receive communications from us electronically and through each of the foregoing methods. By engaging in any telephone conversation with our agents or employees, you consent to our recording such telephone call. You agree that all notices, disclosures, and other communications that we provide to you electronically satisfy any legal requirement that such communications be in writing. You agree that you have the ability to store electronic communications such that they remain accessible to you in an unchanged form.</p>\r\n                \r\n                <p>C. Compliance with Applicable Laws: The Services are controlled within Australia and directed to individuals residing in the Australia. We do not represent that the materials in the Services are appropriate or available for use in any particular location. Those who choose to access the Services do so on their own initiative and are responsible for compliance with all applicable laws in their own jurisdiction. We reserve the right to limit the availability of the Services to any person, geographic area or jurisdiction at any time in our sole discretion.</p>\r\n                \r\n                <p>D. Miscellaneous. You acknowledge that these Terms of Use, any other policies or terms incorporated herein, either in their entirety or by explicit reference, and any other terms and conditions on the Services, constitute the entire agreement between you and us and govern your use of the Services. Australian law governs use of the Services and will be applied in any legal action or arbitration involving use of the Services. If any provision of these Terms of Use is found invalid or unenforceable, that provision will be enforced to the maximum extent permissible by law, and the other provisions of these Terms of Use will remain in force. Our failure to exercise or enforce any right or provision of these Terms of Use shall not constitute a waiver of such right or provision unless acknowledged and agreed by us in writing. You may not assign these Terms of Use or the rights hereunder without our prior written consent. We may assign these Terms of Use and delegate certain responsibilities, obligations, and duties under or in connection with these Terms of Use in our sole discretion.</p>', 'terms-of-use', '2023-04-17 08:46:57', '2023-04-17 08:46:57');
INSERT INTO `pages` (`id`, `title`, `description`, `slug`, `created_at`, `updated_at`) VALUES
(2, 'Privacy Policy', '<a href=\"javascript:void(0);\" onclick=\"sccc(1);\" style=\"color: #00afaa; width: 100%; float: left; margin-bottom: 3px;\" >1. Scope of Privacy Statement</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(2);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >2. Commitment to Privacy</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(3);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >3. Collection of Your Information</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(4);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >4. Use of Your Information</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(5);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >5. Tailored Advertising</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(6);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >6. Do Not Track Signals</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(7);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" > 7. Disclosure of Your Information</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(8);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >8. Opting Out of Communications from Us</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(9);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >9. Notice of Privacy Rights of California Residents</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(10);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >10. Security and Account Protection</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(11);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >11. Children’s Information</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(12);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >12. Accessing, Reviewing, and Changing Personal Information</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(13);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >13. Third Party Links and Services</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(14);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >14. Amendments to Privacy Statement</a>\r\n                <a href=\"javascript:void(0);\" onclick=\"sccc(15);\" style=\"color: #00afaa; width: 100%; float: left;  margin-bottom: 3px;\" >15. International Transfers of Information</a>\r\n                <div class=\"clr\"></div>\r\n                \r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step1\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">1. Scope of Privacy Statement</p>\r\n                    This Privacy Statement (“Privacy Statement”) describes how Egreea, and its affiliates and subsidiaries (collectively, “we,” “us,” “our,” or the “Company”) handle your personal information when you (collectively, “you” or “your”) use the Company’s websites (egree.com and egreea.com.au) and any other website where this Privacy Statement is posted), tools, documents and applications (including mobile applications), and other services, including the services offered. By using the Services, you expressly consent to our collection, storage, use and disclosure of your personal information as described in this Privacy Statement.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step2\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">2. Commitment to Privacy</p>\r\n                    The Company has a strong commitment to providing information tailored to your individual needs while providing excellent service to all of our visitors and customers, including respecting concerns about privacy. We understand that you may have questions about whether and how we collect and use information. This Privacy Statement details the steps we take to respect your privacy concerns.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step3\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">3. Collection of Your Information</p>\r\n                    <u style=\"font-weight:600;\" >Personal Information.</u> We do not collect personal information (such as names, addresses, telephone numbers, email addresses, or financial account information) from you when you browse the Services, unless you have specifically and knowingly provided us with personal information, e.g., by creating an account through the Services (“Egreea”), updating your Egreea Account profile, registering for or participating on the website to submit a legally binding offer or a transaction event and completing online forms or questionnaires.  This information may include, without limitation, information such as your first and last name, e-mail address, telephone number, username, password, billing information, and other information exchanged in connection with real estate transactions. We also may acquire personal information from other sources such as offline records, publicly available information, or from third parties. We use this information to provide the Services and as discussed in this Privacy Statement.\r\n                    <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />\r\n                    \r\n                    <u style=\"font-weight:600;\" >Automatically-Collected Information.</u> We may automatically collect information about the computer or devices (including mobile devices) you use to access the Services, and your interactions with the Services. For example, we may collect and store information such as your browser type, IP address, language, operating system, location of your wireless device (e.g., latitude and longitude), the state or country from which you accessed the Services, unique device identifier (e.g., a UDID or IDFA on Apple devices like the iPhone, iPad and iTouch), the pages you view, length of time spent on pages, communications with other users through the Services, the Services you use and the manner in which you use such Services (e.g., the content you access, view, click on, search for, post, favourite, vote, follow, share, upload, or tag), the date and time of your visit, the websites you visited immediately before and after visiting our Company websites, error logs, and other hardware and software information, as well as other geographic and demographic information. We may use third party analytics providers and technologies, including cookies and similar tools, to assist in collecting this information. We may use this information to formulate statistical models about use of the Services, enhance the Services for our users, and provide you with information about new opportunities, and tailored content, advertising, marketing and as otherwise discussed in this Privacy Statement. To the extent that such information is maintained in a manner that identifies your name or contact information, it will be treated as personal information; otherwise, such information will be treated as non-personal information.\r\n                     <p style=\"float:left; width:100%; padding-bottom:15px;\"></p>  <br />\r\n                    \r\n                    <u style=\"font-weight:600;\" >Our Use of Cookies.</u> The Services use “cookie” technology and similar online tools, such as web beacons and web pixels. “Cookies” are small files that a website stores on a user’s computer or device. The Services use cookies to keep the information you enter on multiple pages together. A majority of cookies we use are “session” cookies, meaning that they are automatically deleted from your hard drive after you close your browser at the end of your session. Session cookies are used to optimize performance of the Services and to limit the amount of redundant data that is downloaded during a single session. We also use “persistent” cookies, which remain on your computer or device unless deleted by you (or by your browser settings). We use persistent cookies for statistical analysis of performance to ensure the ongoing quality of our services. In either case, we do not use cookies to obtain or retain any personal information about you apart from what you voluntarily provide us. Most web browsers automatically accept cookies, but you may set your browser to block cookies (consult the instructions for your particular browser on how to do this). Please note that if you decide to block cookies, this may interfere with your ability to perform certain transactions, use certain functionality, and access certain content on the Services.\r\n                     <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />\r\n                    \r\n                    <u style=\"font-weight:600;\" >Google Analytics.</u> The Company websites may use Google Analytics, a vendor’s service that uses cookies, web beacons, web pixels and/or similar technology to collect and store anonymous information about you, which may include non-personal information described above. You can read Google Analytics’ privacy policy at http://www.google.com/analytics/learn/privacy.html and Google Analytics Terms of Use at http://www.google.com/analytics/tos.html. You can opt-out from being tracked by Google Analytics in the future by downloading and installing Google Analytics Opt-out Browser Add-on for your current web browser at http://tools.google.com/dlpage/gaoptout?hl=en.\r\n                     <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />\r\n                    \r\n                    <u style=\"font-weight:600;\" >User-Initiated Communication.</u> From time to time, portions of the Services, including, without limitation, Services available through the Community, may enable you to send emails and other types of messages to us or to third parties and to participate in bulletin boards and discussion groups. We reserve the right to use reproduce, modify, adapt, publish, translate, create derivative works from, distribute, copy, and display all such emails, messages and discussion groups throughout the world in any form, pursuant to Section 6 of the Terms of Use. Among other things, this right allows us to review your messages with other users to enforce our Terms of Use. Whenever you choose to initiate these kinds of communication with us, or anyone else, you may be contacted in return. Such communications may be identified by your actual name and/or your username, and may be linked to your Community profile. Please use your discretion when deciding whether and what to post and whom to contact and message. We reserve the right, in our sole discretion, to monitor, edit or delete postings from our bulletin boards and discussion groups. This reservation of rights shall not under any circumstances obligate us to conduct such edits or deletions, nor shall it cause us to be liable for any such edits or deletions.\r\n                    <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />\r\n                    The Services may also contain social plugins for other websites, such as Facebook, Twitter, YouTube, LinkedIn and Google+. We recommend reviewing the privacy policies with respect to the social plugins for each of these websites, prior to clicking on such plugins.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step4\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">4. Use of Your Information</p>\r\n                    We will use your information for the purpose for which you provided it, and we may also use your information for a number of purposes such as to:\r\n                    \r\n                    <ul style=\"float:left; width:100%; margin-top:12px; list-style-type:disc; padding-left:15px;\">\r\n                   <li style=\"float:left; width:100%; margin-bottom:10px;\"> Create and maintain your Egreea and account profile, your Community profile, registration information and communication preferences;\r\n                    Enhance the user experience;</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\"> Perform research and analytics; </li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Customize and personalize the content and advertising that you see on the Services;</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Respond to and fulfil your requests for Services (including qualification to make bids or offers) or other 					                    inquiries;</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Determine your eligibility for certain marketing or transaction events, services, gifts, prizes, and special features of the Services;</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Call, email or otherwise contact you to facilitate marketing or transaction events for which you are registered;</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Call, email or otherwise contact you regarding new opportunities relating to marketing or transaction events or our other Services;</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Administer, register or enrol you in, or facilitate your participation in recreational, educational or entertainment activities; surveys or questionnaires; 		   promotions or sweepstakes, or any other services, events or activities sponsored by us or third parties, or offered in connection with our Services;</li>\r\n                  \r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Send you prizes and gifts;</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Enforce our Terms of Use;</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Send you information about topics that may be of interest to you; and</li>\r\n                   <li style=\"float:left; width:100%; margin-bottom:8px;\">  Send you communications related to your Ten-X Account and to alert you to the latest developments and features of the Services.</li>\r\n                    </ul>\r\n                    \r\n                    \r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step5\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">5. Tailored Advertising</p>\r\n                   The Services may include third party tailored ad technology which enables customized and targeted ads to be displayed to you through the Services and on third party websites. We do not share personal information with these third parties; however, when you use the Services, we or third parties operating the ad serving technology may use non-personal information that is collected through cookies, anonymous identifiers, such as an IDFA on iOS devices, web beacons, pixels, or clear GIFs to ensure that appropriate ads are presented and to perform analytics concerning your use of the Services and other websites tracked by these third parties. These technologies also may control the number of times you see a given ad, deliver ads that relate to your interests, and measure the effectiveness of ad campaigns. To the extent any of this information is collected by third parties, you acknowledge and agree that such collection and use is governed by those third parties’ privacy policies and we are not responsible for the privacy practices of such third parties.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step6\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">6. Do Not Track Signals</p>\r\n                  We do not respond to or alter our practices detailed herein based upon your selection of the “Do Not Track” setting or other “opt out” setting or feature that may be offered by your browser; however, we reserve the right to do so in the future.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step7\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">7. Disclosure of Your Information</p>\r\n                    We may share your information in the following ways:\r\n                    <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />\r\n                    We may make information collected through the Services available to subsidiaries and affiliated companies that are under common ownership or control within the Company family.\r\n           			<p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />          \r\n                If you download information on assets listed on our Services or make a bid or offer on a particular asset, the seller and its affiliates and representatives are given access to your information.    \r\n                   <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />      \r\n                    \r\n                    We may share information about our visitors, customers, or former customers with the following types of companies that perform services on our behalf or with whom we have joint marketing agreements:\r\n                    \r\n                      <ul style=\"float:left; width:100%; margin-top:12px; list-style-type:disc; padding-left:15px;\">\r\n                   <li style=\"float:left; width:100%; margin-bottom:10px;\"> \r\n                   Non-financial companies such as envelope stuffers, fulfillment service providers, payment processors, data processors, customer/support services, etc.\r\n                    Enhance the user experience;</li>\r\n                    \r\n				<li>Financial service providers such as companies engaged in banking, mortgage lending, consumer finance, securities, and insurance. </li>                    \r\n                  </ul>\r\n                   <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />      \r\n                  We may share or sell, as allowed by law, information about you with other companies who we believe may have products and services of interest to you. If you would like to opt-out of our sharing of your information with these other companies for their direct marketing purposes, please follow our Third Party Opt-Out Policy described in Section 9 below.\r\n                   \r\n                    <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br />  \r\n                   We may share your information with any person or entity where we believe in good faith that such disclosure is necessary to: (a) comply with the law or in response to a court order, government request, or other legal process; (b) produce relevant documents or information in connection with litigation, arbitration, mediation, adjudication, government or internal investigations, or other legal or administrative proceedings; (c) protect the interests, rights, safety, or property of the Company or others; (d) enforce the Terms of Use on the Services; (e) provide users of the Services with the services they request; (f) provide you with special offers or promotions from us; (g) allow another company that acquires the Company or some or all of its assets to continue to serve you; or (h) operate the Company’s systems properly.\r\n                     <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br /> \r\n                   We may share your information with any person or entity when we have your consent.\r\n                    <p style=\"float:left; width:100%; padding-bottom:15px;\"></p> <br /> \r\n                    We may use and share non-personal information about you or use of the Services, including any de-identified and aggregated data with third parties without limitation.\r\n                    \r\n                    \r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step8\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">8. Opting Out of Communications from Us</p>\r\n                    By creating a Egreea account or registering for or participating in any marketing or transaction event on one of our Company websites, you agree to receive direct mail, email newsletters and other promotional email communications, as well as promotional telephone communications. Similarly, by creating a Community profile you agree to receive email newsletters and other promotional email communications. For example, from time to time we may send you email notices or news updates alerting you to new features, products, promotions, or services pertaining to offerings from us, new opportunities, surveys or our other Services, and, if you have created a Egreea Account or registered for a marketing or transaction on one of our Company websites, we may send you direct mail or call you with respect to same.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step9\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">9. Notice of Privacy Rights of Australian Residents</p>\r\n                    We have adopted a policy of not sharing your personal information with third parties for their direct marketing purposes if you request that we do not do so (“Third Party Opt-Out Policy”). You may make such a request by sending us an email. When contacting us, please indicate your name, address, email address, and what personal information you do not want us to share with third parties for their direct marketing purposes. Please note that there is no charge for controlling the sharing of your personal information or for processing this request.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step10\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">10. Security and Account Protection</p>\r\n                   We have implemented commercially reasonable physical, administrative, technical, and electronic security measures to protect against the loss, misuse, and alteration of your personal information. Despite our best efforts, however, no security measures are perfect or impenetrable. We appreciate your help in safeguarding the integrity of your own and others’ privacy. We encourage you to let us know immediately if you suspect that any personal information you shared with us is being used contrary to this Privacy Statement.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step11\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">11. Children’s Information</p>\r\n                    The Services are not directed toward persons under 18 years of age. We do not knowingly market to or collect any personal information from children under the age of 18. If you are under 18, you are not permitted to submit any personal information to us or the Services. If you provide information to us through the Services, you represent that you are 18 years of age or older. \r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step12\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">12. Accessing, Reviewing, and Changing Personal Information</p>\r\n                   If your personal information changes or is inaccurate, you agree to update your information by updating the account information located in your Egreea Account profile.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step13\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">13. Third Party Links and Services</p>\r\n                    The Services may contain links to third-party websites, including identity verification and social networking websites. Your use of these features may result in the collection or sharing of information about you, depending on the feature. Please be aware that we are not responsible for the content or privacy practices of other websites or services to which we link. We do not endorse or make any representations about third-party websites or services. The personal information you choose to provide to or that is collected by these third parties is not covered by our Privacy Statement. We strongly encourage you to read such third parties’ privacy statements.\r\n                </div>\r\n                <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step14\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">14. Amendments to Privacy Statement</p>\r\n                   We may amend this Privacy Statement at any time by posting the amended terms on the Services. Any changes to this Privacy Statement will become effective upon posting. Your continued use of the Services following these changes means that you accept such revisions. If we make any material changes to this Privacy Statement, we will post the changes here and notify you in the manner and to the extent required by law.\r\n                </div>\r\n                \r\n                 <div style=\"float: left; width: 100%; margin-top:25px;\" id=\"step15\">\r\n                    <p style=\"color:#000; float:left; width:100%; font-size:20px; font-weight:600; padding-bottom:12px;\">15. International Transfers of Information</p>\r\n                   Some of the uses and disclosures mentioned in this Privacy Statement may involve the transfer of your personal information to various countries around the world that may have different levels of privacy protection than your country. By submitting your personal information, you consent to such transfers. By using the Services, or by submitting your personal information to us, you expressly consent to the storage and processing of your personal information in accordance with the laws of Australia, or in the users designated jurisdiction.\r\n                </div>', 'privacy-policy', '2023-04-17 08:46:57', '2023-04-17 08:46:57');
