(5, 'FAQ', '<p><strong>Do I need to get a customer&rsquo;s permission in order to send them text messages?</strong></p>\r\n\r\n                <p>Yes, you do need to get a customer&rsquo;s permission to send them text messages.&nbsp; Federal law consent requirements and industry best practices vary based on whether a text message includes a marketing message. As of October 16, 2013, if you plan to send marketing text messages, prior express written (electronic) consent is a requirement. If you will exclusively send account management text messages (e.g., text messages that alert a consumer about an upcoming payment due date or a missed payment), then you only need &ldquo;prior express consent.&rdquo;</p>\r\n                \r\n                <p><strong>Do I need to get a customer&rsquo;s permission in order to send them text messages?</strong></p>\r\n                \r\n                <p>Yes, you do need to get a customer&rsquo;s permission to send them text messages.&nbsp; Federal law consent requirements and industry best practices vary based on whether a text message includes a marketing message. As of October 16, 2013, if you plan to send marketing text messages, prior express written (electronic) consent is a requirement. If you will exclusively send account management text messages (e.g., text messages that alert a consumer about an upcoming payment due date or a missed payment), then you only need &ldquo;prior express consent.&rdquo;</p>\r\n                \r\n                <p>&nbsp;</p>', 'faq', '2023-04-17 08:46:57', '2023-04-17 08:46:57'),
(6, 'Noticias', '<p><strong>Do I need to get a customer&rsquo;s permission in order to send them text messages?</strong></p>\r\n\r\n                <p>Yes, you do need to get a customer&rsquo;s permission to send them text messages.&nbsp; Federal law consent requirements and industry best practices vary based on whether a text message includes a marketing message. As of October 16, 2013, if you plan to send marketing text messages, prior express written (electronic) consent is a requirement. If you will exclusively send account management text messages (e.g., text messages that alert a consumer about an upcoming payment due date or a missed payment), then you only need &ldquo;prior express consent.&rdquo;</p>\r\n                \r\n                <p><strong>Do I need to get a customer&rsquo;s permission in order to send them text messages?</strong></p>\r\n                \r\n                <p>Yes, you do need to get a customer&rsquo;s permission to send them text messages.&nbsp; Federal law consent requirements and industry best practices vary based on whether a text message includes a marketing message. As of October 16, 2013, if you plan to send marketing text messages, prior express written (electronic) consent is a requirement. If you will exclusively send account management text messages (e.g., text messages that alert a consumer about an upcoming payment due date or a missed payment), then you only need &ldquo;prior express consent.&rdquo;</p>\r\n                \r\n                <p>&nbsp;</p>', 'noticias', '2023-04-17 08:46:57', '2023-04-17 08:46:57'),
(7, 'Trust & Safety', '<p><strong>Do I need to get a customer&rsquo;s permission in order to send them text messages?</strong></p>\r\n\r\n                <p>Yes, you do need to get a customer&rsquo;s permission to send them text messages.&nbsp; Federal law consent requirements and industry best practices vary based on whether a text message includes a marketing message. As of October 16, 2013, if you plan to send marketing text messages, prior express written (electronic) consent is a requirement. If you will exclusively send account management text messages (e.g., text messages that alert a consumer about an upcoming payment due date or a missed payment), then you only need &ldquo;prior express consent.&rdquo;</p>\r\n                \r\n                <p><strong>Do I need to get a customer&rsquo;s permission in order to send them text messages?</strong></p>\r\n                \r\n                <p>Yes, you do need to get a customer&rsquo;s permission to send them text messages.&nbsp; Federal law consent requirements and industry best practices vary based on whether a text message includes a marketing message. As of October 16, 2013, if you plan to send marketing text messages, prior express written (electronic) consent is a requirement. If you will exclusively send account management text messages (e.g., text messages that alert a consumer about an upcoming payment due date or a missed payment), then you only need &ldquo;prior express consent.&rdquo;</p>\r\n                \r\n                <p>&nbsp;</p>', 'trust-safety', '2023-04-17 08:46:57', '2023-04-17 08:46:57'),
(8, 'About US', '<p><strong>We Believe In Action. Community. Quality.</strong></p>\r\n\r\n                <p>Siamo un&rsquo;azienda, ma soprattutto un insieme di persone che hanno in comune una grandissima passione.&nbsp;Ci ispiriamo agli stessi principi cui fanno riferimento le startup di successo: rapidit&agrave;, capacit&agrave; di adattamento e propensione all&#39;ascolto. Sono i nostri pilastri.</p>\r\n                \r\n                <p>Proponiamo ai nostri clienti soluzioni efficaci e corrette, con la spinta innovativa e le forti competenze che ci contraddistinguono, fin da quando eravamo una realt&agrave; piccola, ma piena di sogni ed entusiasmo.</p>', 'about-us', '2023-04-17 08:46:57', '2023-04-17 08:46:57');
